/**
 * CNS1 CID -> Unicode ?亥”嚗int16Array嚗ittle-endian嚗? * ?芸???嚗??踵??耨?? * ?冽?嚗NS1_UNICODE_MAP[cid] = Unicode code point (0 = ?芸?蝢?
 */

const CNS1_B64 =
  "";

let _map: Uint16Array | null = null;

export function getCns1Map(): Uint16Array {{
  if (!_map) {{
    const raw = atob(CNS1_B64);
    const buf = new Uint8Array(raw.length);
    for (let i = 0; i < raw.length; i++) buf[i] = raw.charCodeAt(i);
    _map = new Uint16Array(buf.buffer);
  }}
  return _map;
}}

/** ?斗摮葡?臬??CID passthrough 鈭Ⅳ嚗???銝剖 U+0100-U+1FFF嚗?*/
export function isCidPassthrough(str: string): boolean {{
  if (!str) return false;
  let inRange = 0;
  for (let i = 0; i < str.length; i++) {{
    const cp = str.charCodeAt(i);
    if (cp >= 0x0100 && cp <= 0x1FFF) inRange++;
  }}
  return str.length > 2 && inRange / str.length > 0.4;
}}

/**
 * 撠?CID passthrough 鈭Ⅳ靽格迤?箸迤蝣?Unicode
 * @param str - ?思?蝣潛?摮葡嚗????? charCode = glyph index嚗? * @param offset - glyph_index - CNS1_CID ??蝘駁?嚗FKaiShu ETen-B5-H ??312嚗? */
export function decodeCidFont(str: string, offset = 312): string {{
  const map = getCns1Map();
  let result = "";
  for (let i = 0; i < str.length; i++) {{
    const glyphIndex = str.charCodeAt(i);
    const cns1Cid = glyphIndex - offset;
    const cp = cns1Cid >= 0 && cns1Cid < map.length ? map[cns1Cid] : 0;
    result += cp ? String.fromCharCode(cp) : str[i];
  }}
  return result;
}}
